import React from 'react';
import { Jumbotron, Container } from 'react-bootstrap';
import '../App.css';


function Jumbo() {
    return (
        <div>
            <Jumbotron fluid>
                <Container>
                    <h1>GRETCHEN KRAMMES</h1>
                    <p>Hello there!</p>
                </Container>
            </Jumbotron>
        </div>
    );
  }

  export default Jumbo;
